schema:
{
 "description": "VPCEndpoint is the Schema for the VPCEndpoints API",
 "properties": {
  "spec": {
   "description": "VpcEndpointSpec defines the desired state of VpcEndpoint.\n\n\nDescribes a VPC endpoint.",
   "properties": {
    "dnsOptions": {
     "description": "The DNS options for the endpoint.",
     "properties": {
      "dnsRecordIPType": {
       "type": "string"
      }
     },
     "type": "object"
    },
    "ipAddressType": {
     "description": "The IP address type for the endpoint.",
     "type": "string"
    },
    "policyDocument": {
     "description": "(Interface and gateway endpoints) A policy to attach to the endpoint that\ncontrols access to the service. The policy must be in valid JSON format.\nIf this parameter is not specified, we attach a default policy that allows\nfull access to the service.",
     "type": "string"
    },
    "privateDNSEnabled": {
     "description": "(Interface endpoint) Indicates whether to associate a private hosted zone\nwith the specified VPC. The private hosted zone contains a record set for\nthe default public DNS name for the service for the Region (for example,\nkinesis.us-east-1.amazonaws.com), which resolves to the private IP addresses\nof the endpoint network interfaces in the VPC. This enables you to make requests\nto the default public DNS name for the service instead of the public DNS\nnames that are automatically generated by the VPC endpoint service.\n\n\nTo use a private hosted zone, you must set the following VPC attributes to\ntrue: enableDnsHostnames and enableDnsSupport. Use ModifyVpcAttribute to\nset the VPC attributes.\n\n\nDefault: true",
     "type": "boolean"
    },
    "routeTableIDs": {
     "description": "(Gateway endpoint) One or more route table IDs.",
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "routeTableRefs": {
     "items": {
      "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
      "properties": {
       "from": {
        "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
        "properties": {
         "name": {
          "type": "string"
         }
        },
        "type": "object"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "securityGroupIDs": {
     "description": "(Interface endpoint) The ID of one or more security groups to associate with\nthe endpoint network interface.",
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "securityGroupRefs": {
     "items": {
      "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
      "properties": {
       "from": {
        "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
        "properties": {
         "name": {
          "type": "string"
         }
        },
        "type": "object"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "serviceName": {
     "description": "The service name. To get a list of available services, use the DescribeVpcEndpointServices\nrequest, or get the name from the service provider.",
     "type": "string"
    },
    "subnetIDs": {
     "description": "(Interface and Gateway Load Balancer endpoints) The ID of one or more subnets\nin which to create an endpoint network interface. For a Gateway Load Balancer\nendpoint, you can specify one subnet only.",
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "subnetRefs": {
     "items": {
      "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
      "properties": {
       "from": {
        "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
        "properties": {
         "name": {
          "type": "string"
         }
        },
        "type": "object"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "tags": {
     "description": "The tags. The value parameter is required, but if you don't want the tag\nto have a value, specify the parameter with no value, and we set the value\nto an empty string.",
     "items": {
      "description": "Describes a tag.",
      "properties": {
       "key": {
        "type": "string"
       },
       "value": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "vpcEndpointType": {
     "description": "The type of endpoint.\n\n\nDefault: Gateway",
     "type": "string"
    },
    "vpcID": {
     "description": "The ID of the VPC in which the endpoint will be used.",
     "type": "string"
    },
    "vpcRef": {
     "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
     "properties": {
      "from": {
       "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
       "properties": {
        "name": {
         "type": "string"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    }
   },
   "required": [
    "serviceName"
   ],
   "type": "object"
  }
 },
 "title": "VPC Endpoint",
 "type": "object"
}
